`location_id`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '位置id' ,
`pallet_size`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '托盘尺寸id' ,
`po_no`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '采购单id' ,
`po_line_no`  int(10) NULL DEFAULT NULL COMMENT '采购单序号' ,
`lot_no`  varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '批次' ,
`goods_total`  int(10) NULL DEFAULT NULL COMMENT 'line下所有收到的正常的货物' ,
`damage_total`  int(10) NULL DEFAULT NULL COMMENT 'line下所有收到的损坏的货物' ,
`expected_qty`  int(10) NULL DEFAULT NULL COMMENT '预定数量' ,
`pallets`  double(10,2) NULL DEFAULT NULL COMMENT '托盘数' ,
`note`  varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注' ,
`qty_per_pallet`  int(10) NULL DEFAULT NULL COMMENT '推荐每托盘装货数,对应QtyPerUnit' ,
`is_check_sn`  bit(1) NULL DEFAULT NULL COMMENT '是否需要sn的验证,对应ValidatedInboundSerialNo' ,
`sn_size`  int(10) NULL DEFAULT NULL COMMENT 'sn长度,对应SerialNoLength' ,
`is_check_lot_no`  bit(1) NULL DEFAULT NULL COMMENT '是否需要lot_no验证,对应SerialNoScanLotNoCheck' ,
`wms_item`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`wms_lot_no`  varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`wms_qty`  int(10) NULL DEFAULT NULL ,
`supplier`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '供应商(title)' ,
`status`  int(10) NULL DEFAULT 0 COMMENT '0:WMS原始数据;2:做完count;3:做完CC;4:做完scan' ,
`is_sku_type`  bit(1) NULL DEFAULT NULL COMMENT '0:表示普通line;1:表示sku类型的cc task' ,
`pc_id`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '商品pcid' ,
`close_date`  datetime NULL DEFAULT NULL COMMENT '关闭时间' ,
`close_user`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '关闭人' ,
`detail_id`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT 'door_or_location_occupancy_details' ,
`unloading_start_time`  datetime NULL DEFAULT NULL ,
`unloading_finish_time`  datetime NULL DEFAULT NULL ,
`counted_user`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '最后一个count的人' ,
`scan_start_adid`  int(10) UNSIGNED NULL DEFAULT NULL ,
`scan_start_time`  datetime NULL DEFAULT NULL ,
`scan_end_adid`  int(10) UNSIGNED NULL DEFAULT NULL ,
`scan_end_time`  datetime NULL DEFAULT NULL ,
`close_adid`  int(10) UNSIGNED NULL DEFAULT NULL ,
`close_time`  datetime NULL DEFAULT NULL ,
`assign_time`  datetime NULL DEFAULT NULL ,
`cc_start_time`  datetime NULL DEFAULT NULL ,
`cc_finish_time`  datetime NULL DEFAULT NULL ,
`cc_user`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '做cc的人' ,
PRIMARY KEY (`receipt_line_id`),
FOREIGN KEY (`receipt_id`) REFERENCES `receipts` (`receipt_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `fk_receipt_id` USING BTREE (`receipt_id`)
)
