-- ----------------------------
-- Table structure for receipts
-- ----------------------------
DROP TABLE IF EXISTS `receipts`;
CREATE TABLE `receipts` (
`receipt_id`  int(10) UNSIGNED NOT NULL AUTO_INCREMENT ,
`ps_id`  int(10) UNSIGNED ZEROFILL NOT NULL DEFAULT 0000000000 COMMENT '仓库id' ,
`company_id`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '仓库id' ,
`receipt_no`  int(10) UNSIGNED NOT NULL COMMENT '入库单id' ,
`status`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'open,closed,imported,reveived' ,
`customer_key`  int(10) UNSIGNED ZEROFILL NULL DEFAULT NULL COMMENT '客户id' ,
`customer_id`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'WMS客户id' ,
`supplier_key`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '供应商id' ,
`supplier_id`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'WMS供应商(title)' ,
`entered_date`  datetime NULL DEFAULT NULL COMMENT '建单日期' ,
`warehouse_id`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '仓库id' ,
`reference_no`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '参考号' ,
`po_no`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '采购单id' ,
`bol_no`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出库单号' ,
`container_no`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '货柜号' ,
`seals`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '封条' ,
`scac`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '卡车公司编码' ,
`carrier_id`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'WMS运输公司' ,
`schedule_date`  datetime NULL DEFAULT NULL COMMENT '预定时间' ,
`appointment_date`  datetime NULL DEFAULT NULL COMMENT '预约时间' ,
`in_yard_date`  datetime NULL DEFAULT NULL COMMENT '抵达时间' ,
`devanner_date`  datetime NULL DEFAULT NULL COMMENT '入库时间' ,
`last_free_date`  datetime NULL DEFAULT NULL COMMENT '码头最后免费存货日期' ,
`receipt_type`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'transfer,receipt' ,
`note`  varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注' ,
`carton_label_printed`  bit(1) NULL DEFAULT NULL COMMENT '箱于标签是否已打印' ,
`plate_printed`  bit(1) NULL DEFAULT NULL COMMENT '托盘标签是否已打印' ,
`receipt_ticket_printed`  bit(1) NULL DEFAULT NULL COMMENT '收货单票据是否已打印' ,
`tally_sheet_printed`  bit(1) NULL DEFAULT NULL COMMENT '记录单是否已打印' ,
`receipt_printed`  bit(1) NULL DEFAULT NULL COMMENT '收货单是否已打印' ,
`link_sequence_no`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`re_control_no`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`edi_order`  bit(1) NULL DEFAULT NULL ,
`send944`  bit(1) NULL DEFAULT NULL ,
`send947`  bit(1) NULL DEFAULT NULL ,
`date_created`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`user_created`  varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人' ,
`date_updated`  datetime NULL DEFAULT NULL COMMENT '最后更新时间' ,
`user_updated`  varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '最后更新人' ,
`detail_id`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT 'door_or_location_occupancy_details' ,
`print_date`  datetime NULL DEFAULT NULL COMMENT '最近打印时间' ,
`print_user`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '最近打印人' ,
`print_number`  int(10) NULL DEFAULT NULL COMMENT '最近打印次数' ,
`close_user`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT 'close user adid' ,
PRIMARY KEY (`receipt_id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
